<template layout="main">
    <Head>
        <title>Frequently asked Question</title>
        <meta name="description" content="Do you have a question about embroidery? We are here to help">

    </Head>
    <!--structured data-->
    <Teleport to="head">
        <component :is="'script'"  type="application/ld+json">
        {{jsonLd}}
        </component>
    </Teleport>
  <div class="py-14 text-center">
    <h6 class="font-bold">FAQS</h6>
      <h1 class="font-black text-2xl md:text-4xl mt-4">Frequently asked Questions</h1>
      <h6 class="text-xl font-light mt-5">Have any Questions? We are here to help.</h6>
  </div>
    <div class="mt-3 px-3 w-full pb-5 flex justify-center">
        <form class="w-full md:w-1/2 px-5">

            <div class="relative w-full">
                <div class="flex absolute inset-y-0 left-0 items-center pl-3 pointer-events-none">
                    <svg aria-hidden="true" class="w-5 h-5 text-gray-500 dark:text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z"></path></svg>
                </div>
                <input type="search" id="default-search" class="block p-3 pl-10 w-full text-sm text-gray-900 bg-white rounded-lg border border-gray-300 focus:ring-gray-700 focus:border-gray-700" placeholder="Search FAQs..." required v-model="search">

            </div>
        </form>
    </div>

    <div class="py-2">
        <ul class="flex gap-3 justify-center text-gray-600 font-bold text-sm">
            <li class="hover:text-teal-700">
                <Link :href="route('help-center.index')" class="capitalize">All</Link>
            </li>
            <li v-for="category in categories" :key="category.id" class="hover:text-teal-700">
                <Link :href="route('help-center.show', category.slug)" class="capitalize">{{ category.name }}</Link>
            </li>
        </ul>
    </div>

    <div class="px-3 md:px-48 py-16 justify-center w-full" v-if="faqs.data.length">
        <accordion :id="faq.id" v-for="faq in faqs.data" :key="faq.id" class="my-8">
            <template #title>
                <span class="font-semibold">{{faq.question}}</span>

            </template>
            <template #content>
                <p>
                    {{faq.answer}}
                </p>
            </template>
        </accordion>

        <div class="flex justify-center mt-8">
            <Link :href="faqs.links.prev" class="btn-primary text-xs m-1" v-if="faqs.links.prev"><span
                class="mr-2"><i class="far fa-angle-left"></i></span>Prev
            </Link>
            <Link :href="faqs.links.next" class="btn-primary text-xs m-1" v-if="faqs.links.next">Next
                <span class="ml-2"><i class="far fa-angle-right"></i></span></Link>

        </div>
    </div>
    <div v-else class="flex justify-center my-5">
        <h6 class="font-bold">Sorry! We could not find what you are looking for</h6>
    </div>
    <div class="my-14">
        <div class="flex justify-center">
            <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="60" height="60" viewBox="0 0 82 82">
                <defs>
                    <pattern id="pattern" preserveAspectRatio="none" width="100%" height="100%" viewBox="0 0 231 231">
                        <image width="231" height="231" xlink:href="data:image/png;base64,"/>
                    </pattern>
                </defs>
                <g id="Component_1_1" data-name="Component 1 – 1" transform="translate(1 1)">
                    <rect id="Rectangle_28" data-name="Rectangle 28" width="80" height="80" rx="40" stroke="#fff" stroke-width="2" fill="url(#pattern)"/>
                </g>
            </svg>

        </div>
        <div class="mt-5 flex justify-center">
            <div class="text-center">
                <h6 class="text-xl font-bold">Still have Question?</h6>
                <p class="font-medium text-lg mt-2">Can't find the answers you are looking for?
                    <Link class="text-teal-700" href="#">Please chat with our friendly team</Link></p>
            </div>
        </div>
    </div>
</template>

<script setup lang="ts">
import {Link} from "@inertiajs/inertia-vue3";
import Accordion from "@/views/components/accordion.vue";
import {Head} from "@inertiajs/inertia-vue3";
import {ref, watch} from "vue";
import {Inertia} from "@inertiajs/inertia";
import _ from "lodash"
let props=defineProps({
    categories:Object,
    faqs:Object,
    search:String
})
let search=ref(props.search)
watch(search, _.debounce(function (value) {
    Inertia.get(route('help-center.index'),{
        search:value
    }, {preserveState:true, replace:true});
}, 300))

const jsonLd={
    "@context": "https://schema.org",
    "@type": "FAQPage",
    "mainEntity":[

    ]
}
props.faqs.data.forEach(q=>{
    jsonLd.mainEntity.push({
        "@type": "Question",
        "name": q.question,
        "acceptedAnswer": {
            "@type": "Answer",
            "text":q.answer,
    }})
})



</script>

<style scoped>

</style>
